Introduction/0.GettingStarted.html.body:
설치 및 시작

원문 https://jestjs.io/docs/en/getting-started

yarn을 이용하여 설치하거나,
yarn add --dev jest
npm을 이용하여 설치할 수 있습니다.
npm install --save-dev jest
두 개의 숫자를 더하는 간단한 함수를 예시로 삼아 테스트를 작성하겠습니다. 먼저, sum.js 파일을 만듭니다.
function sum(a, b) {
  return a + b;
}
module.exports = sum;

그 다음, sum.test.js라는 이름의 테스트 파일을 작성합니다. 이 파일에서 실제 테스트가 일어납니다.
const sum = require("./sum");

test("1 + 2 의 값은 3과 같다", () => {
  expect(sum(1, 2)).toBe(3);
});

package.json 파일 안에 다음을 추가합니다.
{
    "scripts": {
        "test": "jest"
    }
}
마지막으로, yarn test를 터미널에서 실행하면 Jest 는 다음 메세지를 출력할 것입니다.
PASS ./sum.test.js
adds 1 + 2 to equal 3 (5ms)
Jest 를 이용한 첫번째 테스트 작성을 성공적으로 끝마쳤습니다!
이 테스트는 두 값(1 + 2, 3)이 정확히 동일한지 테스트하기 위해 expect와 toBe를 사용했습니다. Jest 테스트에서 값을 비교할 때 사용할 수 있는 더 많은 Matcher에 대해 배우고 싶다면, [Using Matchers]문서를 참고하세요.
커맨드 라인에서 실행하기
CLI에서 Jest를 바로 실행시킬 수도 있습니다. 다양하고 유용한 옵션들도 사용할 수 있습니다. (단, yarn global add jest 등을 이용한 설치를 통해 전역적인 Jest 사용이 가능해야 합니다.)
설정 파일인 config.json와 함께 Jest 로 my-test파일을 테스트해보겠습니다. 실행 후에는 네이티브 OS 알림 로그가 표시될 것입니다.
jest my-test --notify --config=config.json
커맨드 라인을 이용한 jest 명령어 사용에 대해 더 자세히 배우고 싶다면, [Jest CLI Options]문서를 참고하세요.
추가 설정
기본 설정 파일 만들기
다음 명령어를 실행하면 Jest는 당신의 현 프로젝트에 기반하여 몇 가지 질문을 한 다음, 기본적인 설정 파일을 생성해 줄 것입니다. 이 파일의 각 옵션에는 짧은 설명이 달려 있습니다.
jest --init
바벨 사용
[Babel]을 쓰기 위해선 babel-jest와 regenerator-runtime 패키지가 설치되어 있어야 합니다.
yarn add --dev babel-jest babel-core regenerator-runtime

Note: 만일 Babel 7버전을 사용하고 있다면, babel-jest,babel-core@^7.0.0-bridge.0 그리고 @babel/core를 설치해야 합니다. yarn add --dev babel-jest babel-core@^7.0.0-bridge.0 @babel/core regenerator-runtimenode_modules를 트랜스파일하기 위해선 babel.config.js를 이용해야 합니다. 더 자세한 것은 https://babeljs.io/docs/en/next/config-files 를 참고하세요. 다음 저장소에서 예시를 확인할 수 있습니다. https://github.com/facebook/jest/tree/master/examples/babel-7

Note: npm 3,4버전, 혹은 yarn을 사용 중이라면 명시적으로 regenerator-runtime을 설치할 필요는 없습니다.
프로젝트의 루트 폴더에 .babelrc 파일을 꼭 추가하세요. 예를 들어 ES6와 [React.js]가 사용된 프로젝트에 babel-preset-env와 babel-preset-react 프리셋을 적용하고 싶다면 다음처럼 작성하면 됩니다.
{
  "presets": ["env", "react"]
}

이제 모든 ES6 기능과 React 특유적인 문법들을 사용할 수 있도록 환경이 세팅되었습니다.

Note: 만일 env옵션과 함께 더 복잡한 Babel 설정을 사용하고 있다면, Jest는 자동적으로 NODE_ENV를 test로 정의할 것입니다. 다시 말해, Jest 는 NODE_ENV가 정의되어 있지 않을때 Babel 이 기본적으로 수행했을 development 섹션을 사용하지 않습니다.
Note: 만약 프로젝트가 {"modules": false} 등의 옵션으로 ES6 모듈을 트랜스파일하지 않더라도, 테스트 환경에선 ES6 모듈을 트랜스파일하는 방향으로 옵션이 설정되어 있어야만 합니다.

{
  "presets": [["env", { "modules": false }], "react"],
  "env": {
    "test": {
      "presets": [["env"], "react"]
    }
  }
}


Note: babel-jest는 Jest가 설치될 때 자동 설치됩니다. 또한 현 프로젝트에 바벨 설정이 적용되어 있다면 파일들을 자동으로 변환해 줄 것입니다. 이를 막고 싶다면, 명시적으로 transform 설정 옵션을 다음처럼 리셋시켜야 합니다.

// package.json
{
  "jest": {
    "transform": {}
  }
}

Webpack 사용하기
Webpack은 여러 자원과 컴파일을 매니징할 수 있게 도와주는 모듈 번들러입니다. Jest는 Webpack이 적용되어있는 프로젝트에서도 쓸 수 있습니다. Webpack은 그 어떤 툴보다 더 유용하고 멋진 기능을 제공하고 있으니, 관련 내용이 궁금하다면 [Webpack과 함께 사용하기] 문서를 보시기 바랍니다.
Typescript 사용하기
Typescript를 Jest와 함께 쓰고 싶다면 [ts-jest]를 사용하세요.

Introduction/1.UsingMatchers.html.body:
Using Matchers

Matcher 사용하기

Jest는 다양한 방법으로 값을 테스트하기 위해 Matcher라는 것을 사용합니다. 이 문서에서는 주로 쓰이는 Matcher들을 소개하려고 합니다. 모든 Matcher들에 대해 알고 싶다면, expect API doc문서를 참고해주세요.
자주 쓰는 Matcher
값을 테스트하는 가장 단순한 방법은 정확히 동일한지를 알아보는 것입니다.
test('2 + 2는 4다`, () => {
    expect(2 + 2).toBe(4);
});

expect(2 + 2)는 expectation(기댓값) 객체를 반환합니다. expectation 객체에 Matcher를 적용해 실제값과 기댓값을 서로 비교합니다. 위 코드에서 Matcher는 .toBe(4)입니다. Jest는 실행시 모든 Matcher의 테스트 결과를 추적하며, 실패한 테스트 결과는 모두 에러 메세지에 출력됩니다.
toBe는 두 값이 엄격하게 동일한지를 체크하기 위해 Object.is를 사용합니다. 그저 객체의 값이 같은 지만을 체크하고 싶다면, toEqual을 사용해도 좋습니다.
test("객체 할당", () => {
  const data = { one: 1 };
  data["two"] = 2;
  expect(data).toEqual({ one: 1, two: 2 });
});

toEqual은 객체나 배열의 모든 값을 재귀적으로 돌면서 테스트를 진행합니다. 반대의 경우를 테스트하고 싶다면 Matcher에 not을 붙이면 됩니다.
