참 & 거짓
때로는 undefined, null 그리고 false의 값을 구분하여 테스트해야할 경우가 있습니다. Jest는 이러한 니즈를 충족하는 다음의 기능들을 제공합니다.

toBeNull은 null인 값에만 매칭됩니다.
toBeUndefined는 undefined인 값에만 매칭됩니다.
toBeDefined는 toBeUndefined의 반대 경우를 테스트할 때 쓰입니다.
toBeTruthy는 true로 취급되는 값이 있으면 매칭됩니다.
toBeFalsy는 false로 취급되는 값이 있으면 매칭됩니다.

test("null", () => {
  const n = null;

  // 모두 true를 반환합니다.
  expect(n).toBeNull();
  expect(n).toBeDefined();
  expect(n).not.toBeUndefined();
  expect(n).not.toBeTruthy();
  expect(n).toBeFalsy();
});

test("zero", () => {
  const z = 0;

  // 모두 true를 반환합니다.
  expect(z).not.toBeNull();
  expect(z).toBeDefined();
  expect(z).not.toBeUndefined();
  expect(z).not.toBeTruthy();
  expect(z).toBeFalsy();
});

Matcher는 코드의 목적에 맞게 테스트할 수 있게끔 최대한 정확하게 써야 합니다.
숫자
숫자를 비교하는 가장 흔한 방법은 두 값이 동일한지를 살펴보는 것입니다.
test("2에 2를 더한다", () => {
  const value = 2 + 2;
  expect(value).toBeGreaterThan(3);
  expect(value).toBeGreaterThan(3.5);
  expect(value).toBeLessThan(5);
  expect(value).toBeLessThanOrEqual(4.5);

  // toBe와 toEqual은 숫자에 대해서는 동일하게 동작합니다.
  expect(value).toBe(4);
  expect(value).toEqual(4);
});

정수가 아닌 실수값인 경우, 두 값이 동일한지 테스트할 때 toEqual 대신 toBeCloseTo를 써야 합니다. 그러지 않으면 작은 끝수처리 오차로 인해 테스트가 오동작할 수 있습니다.
test("실수값을 더한다", () => {
  const value = 0.1 + 0.2;

  // expect(value).toBe(0.3); 소숫점 단위의 오차로 인해 테스트를 통과하지 못합니다.
  expect(value).toBeCloseTo(0.3); // 테스트를 통과합니다.
});

문자열
toMatch를 사용하면 정규식을 이용한 문자열 테스트가 가능합니다.
test("team에는 I라는 글자가 없다", () => {
  expect("team").not.toMatch(/I/);
});

test("Christoph에는 stop이라는 글자가 포함되어 있다.", () => {
  expect("Christoph").toMatch(/stop/);
});

배열
toContain을 사용하면 배열이 특정 요소를 가지고 있는지 테스트할 수 있습니다.
const shoppingList = [
  "diapers",
  "kleenex",
  "trash bags",
  "paper towels",
  "beer"
];

test("shoppingList에 beer가 포함되어 있다", () => {
  expect(shoppingList).toContain("beer");
});

예외 처리
에러를 내뱉는 함수를 테스트하고 싶다면, toThrow를 사용합니다.
function compileAndroidCode() {
  throw new ConfigError("잘못된 JDK를 사용하고 있습니다.");
}

test("compileAndroidCode 함수는 에러를 내야 한다", () => {
  expect(compileAndroidCode).toThrow();
  expect(compileAndroidCode).toThrow(ConfigError);

  // 정확한 에러메세지 문자열이나, 정규식을 활용할 수도 있습니다.
  expect(compileAndroidCode).toThrow("잘못된 JDK를 사용하고 있습니다.");
  expect(compileAndroidCode).toThrow(/JDK/);
});

더 알아보고 싶다면
이건 그저 맛보기였을 뿐입니다. 사용 가능한 모든 Matcher들을 보고 싶다면, 참고 문서를 확인하세요.
사용 가능한 Matcher들에 대해 배웠으니, 다음 단계에선 Jest로 [비동기 코드를 테스트하는 방법]에 대해 배워보도록 하겠습니다.

Introduction/2.TestingAsynchronousCode.h.body:
Testing Asynchronous Code

비동기 코드를 테스트하는 방법

비동기 코드는 자바스크립트에서 흔하게 볼 수 있는 코드입니다. 비동기적으로 동작하는 코드를 테스트하기 위해서, Jest 는 그 코드가 언제 동작을 완료하는지 알아야만 다음 테스트로 넘어가는 우를 범하지 않을 것입니다. Jest 는 다음과 같은 방법으로 비동기 코드를 테스트할 수 있습니다.
Callbacks
콜백 함수는 가장 흔하게 볼 수 있는 비동기 패턴입니다.
fetchData(callback)라는 함수를 예시로 들어보겠습니다. 이 함수는 데이터를 요청한 후 데이터가 도착하면 callback(data)를 호출합니다. 여기서 반환된 데이터 값이 문자열 'peanut butter'임을 테스트해야 하는 상황이라고 가정해보겠습니다.
기본적으로, Jest 는 마지막 코드까지 실행되면 테스트를 끝마칩니다. 다시 말해 다음 코드로 작성된 테스트는 의도한 대로 작동하지 않을 것입니다.
// 이렇게 하지 마세요!
test("data의 값은 peanut butter이다", () => {
  function callback(data) {
    expect(data).toBe("peanut butter");
  }

  fetchData(callback);
});

fetchData가 실행되는 순간, 테스트는 콜백 함수가 미처 호출되지 못한 채로 종료되어버립니다.
이를 바로잡고 싶다면, test의 방식을 조금 바꾸어야 합니다. 기존 코드처럼 빈 인수를 넣는 대신, done이라는 인수를 넣으면 됩니다. 그러면 Jest 는 done이 호출될 때까지 테스트를 종료하지 않고 기다릴 것입니다.
test("data의 값은 peanut butter이다", done => {
  function callback(data) {
    expect(data).toBe("peanut butter");
    done();
  }

  fetchData(callback);
});

만약 done이 실행되지 않는다면 테스트는 실패할 것입니다. 정확히 의도한 대로죠.
Promises
만약 Promise 를 사용 중이라면, 비동기 코드를 더 쉽게 테스트할 수 있습니다. Jest 로 하여금 테스트로부터 Promise 를 리턴하게 하면, Jest 는 해당 Promise 가 resolve 될 때까지 기다립니다. 만약 Promise 가 reject 되면, 테스트는 실패합니다.
fetchData라는 함수를 다시 예시로 들어보겠습니다. 이전과 달리 이 함수는 callback 을 쓰지 않고, 문자열 'peanut butter'로 resolve 되는 Promise 를 반환합니다. 이런 경우엔 다음처럼 테스트하면 됩니다.
test("data의 값은 peanut butter이다", () => {
  expect.assertions(1);
  return fetchData().then(data => {
    expect(data).toBe("peanut butter");
  });
});

Promise 를 반환하는 것을 잊지 마세요. 만일 이 return 코드를 빠뜨린다면, 테스트는 fetchData의 동작이 완료되기도 전에 종료될 것입니다.
만약 Promise 가 reject 되는 경우를 테스트하고 싶다면, .catch 메소드를 사용하면 됩니다. expect.assertions를 추가하는 것을 잊지 마세요. 이 함수는 assertion(번역자: 단언이라는 뜻, 즉 테스트로 ~일 것이다라고 선언한 부분을 일컫습니다. 쉽게는 expect 구문이라고 보면 됩니다.)이 정확히 몇 번 실행되었는지를 테스트합니다. 이를 추가하지 않을 경우, 만약 Promise 가 resolve 되어버리면 테스트는 그대로 통과되어버릴 것입니다.
test("error가 나면서 데이터 fetch에 실패한다", () => {
  expect.assertions(1);
  return fetchData().catch(e => expect(e).toMatch("error"));
});

.resolves / .rejects
expect 에 활용할 수 있는 .resolves Matcher 도 있습니다. 이를 사용하면 Jest 는 해당 Promise 가 resolve 될 때까지 기다립니다. 만약 Promise 가 reject 된다면, test 는 자동적으로 실패합니다.
test("the data is peanut butter", () => {
  expect.assertions(1);
  return expect(fetchData()).resolves.toBe("peanut butter");
});

assertion 을 return 하는 것을 잊지 마세요. 만약 이 return구문을 생략한다면, 테스트는 fetchData가 실행을 끝마치기도 전에 먼저 종료되어버릴 것입니다.
만약 Promise 가 reject 되는 경우를 테스트하고 싶다면, .rejects Matcher 를 쓰면 됩니다. .resolves Matcher 와 유사한 방식입니다. 만약 Promise 가 resolve 된다면, 테스트는 실패할 것입니다.
test("the fetch fails with an error", () => {
  expect.assertions(1);
  return expect(fetchData()).rejects.toMatch("error");
});

Async / Await
테스트에 async와 await를 쓸 수도 있습니다. 비동기 코드를 테스트하기 위해, 테스트하고자 하는 함수 앞에 async 키워드를 붙이기만 하면 됩니다. 앞서 언급되었던 fetchData를 다시 예시로 들어보겠습니다.
test("the data is peanut butter", async () => {
  expect.assertions(1);
  const data = await fetchData();
  expect(data).toBe("peanut butter");
});

test("the fetch fails with an error", async () => {
  expect.assertions(1);
  try {
    await fetchData();
  } catch (e) {
    expect(e).toMatch("error");
  }
});

물론, async & await을 .resolves & .rejects와 결합해서 쓸 수도 있습니다.
test("the data is peanut butter", async () => {
  expect.assertions(1);
  await expect(fetchData()).resolves.toBe("peanut butter");
});

test("the fetch fails with an error", async () => {
  expect.assertions(1);
  await expect(fetchData()).rejects.toMatch("error");
});

이처럼 async와 await은 Promise 를 이용한 예제에서 효율적인 문법 설탕(syntactic sugar)으로 활용할 수 있습니다.
위에 언급한 여러 방식 중에 절대적으로 우월한 방식은 없습니다. 테스트 코드의 가독성을 높이기 위해, 당신의 기존 코드 베이스에 맞춰 적절한 방식을 활용하면 됩니다.

