// Scoped afterEach
// Nested afterAll
// Scoped afterAll

Order of execution of describe and test blocks

describe와 test의 실행 순서

Jest는 test이 실제로 실행되기 전에 모든 describe의 핸들러를 실행합니다. 이는 사전작업 및 후속작업을 before* 및 after* 핸들러에서 별도로 처리하는 또 다른 이유이기도 합니다. 한번 describe 내부를 훑고 지나가면, Jest는 순서대로 test을 실행시킵니다. test는 선행 test가 깔끔하게 정리되고 완료될 때까지 차례를 기다립니다.
다음은 설명을 위한 테스트 코드와 출력 결과입니다.
describe("outer", () => {
  console.log("describe outer-a");

  describe("describe inner 1", () => {
    console.log("describe inner 1");
    test("test 1", () => {
      console.log("test for describe inner 1");
      expect(true).toEqual(true);
    });
  });

  console.log("describe outer-b");

  test("test 1", () => {
    console.log("test for describe outer");
    expect(true).toEqual(true);
  });

  describe("describe inner 2", () => {
    console.log("describe inner 2");
    test("test for describe inner 2", () => {
      console.log("test for describe inner 2");
      expect(false).toEqual(false);
    });
  });

  console.log("describe outer-c");
});

// describe outer-a
// describe inner 1
// describe outer-b
// describe inner 2
// describe outer-c
// test for describe inner 1
// test for describe outer
// test for describe inner 2

General Advice

일반적인 조언

만약 테스트가 실패한다면, 가장 먼저 체크해야할 것 중의 하나가 바로 해당 테스트만이 유일하게 실행되는 경우에도 똑같이 실패하는지에 대한 유무입니다. Jest에서 단 하나의 test를 실행시키는 것은 단순합니다. test를 test.only로 잠깐 바꿔보기만 하면 됩니다.
test.only("실행되는 유일한 테스트입니다", () => {
  expect(true).toBe(true);
});

test("이 테스트는 실행되지 않습니다", () => {
  expect("A").toBe("A");
});

하나의 큰 Test Suite 내에서 특정 테스트가 실패한다면, 해당 테스트를 단독으로 실행시켜 봅니다. 만약 단독 실행시에 해당 테스트가 성공한다면, 동일 Test Suite 내의 다른 테스트가 이 테스트에 간섭해 실패를 일으키고 있을 확률이 높습니다. 이러한 문제는 각 테스트들의 공유 state를 beforeEach로 깔끔히 정리했을 때도 종종 해결되곤 합니다. 일부 공유 state가 의도치않게 수정되었는지 확인하고 싶다면, beforeEach를 활용하여 단순히 데이터 로그만 찍어보는 것도 좋은 방법입니다.
